import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { EmployeesProfileCard } from "../Profile/components/EmployeesProfileCard";
import { BsArrowLeft } from "react-icons/bs";
import { propTypes } from "react-bootstrap/esm/Image";
export const ApplyLeave = () => {
  const ApplyLeaveRightCard = () => {
    return (
      <>
        <div className="col-12">
          <div className="profile_iner_cont">
            <div className="ApplyLeave_right_card">
              <h3>{props.TopPageTitle}</h3>
              <p>
                {props.text}/<span>{props.textInner}</span>
              </p>
            </div>
          </div>
        </div>
      </>
    );
  };
  const InfoCardAppData = [
    {
      backgroundcolor: "#0043ce",
      textcolor: "white",
      cardtitle: "Total Employees",
      date: "28",
      dashbaordIcon: D1,
      iconbackgroundcolor: "#2062ec",
      url: "/hr/organizationchart",
    },
    {
      backgroundcolor: "#F1C21B",
      textcolor: "black",
      cardtitle: "Onboarding This Week",
      date: "12",
      dashbaordIcon: D2,
      iconbackgroundcolor: "#FEDA5A",
      url: "/hr/organizationchart",
    },
    {
      backgroundcolor: "#900F9B",
      textcolor: "white",
      cardtitle: "Interviews This week",
      date: "12",
      dashbaordIcon: D3,
      iconbackgroundcolor: "#B916C7",
      url: "/hr/organizationchart",
    },
    {
      backgroundcolor: "#DA1E28",
      textcolor: "white",
      cardtitle: "Releiving This Week",
      date: "12",
      dashbaordIcon: D4,
      iconbackgroundcolor: "#FB404A",
      url: "/hr/organizationchart",
    },
  ];
  return (
    <>
      <div className="custom_container">
        <TopPageTitle
          TilelIcon={<BsArrowLeft />}
          TitleLink={-1}
          Name="Apply Leave"
        />
        <EmployeesProfileCard />
        <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
          <div className="col-8">
            <div className="profile_iner_cont">kfdmvk</div>
          </div>
          <div className="col-4">
            <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
              {ApplyLeaveRightCardData.map((val, i) => {
                return (
                  <ApplyLeaveRightCard
                    key={i}
                    TopPageTitle={val.TopPageTitle}
                    text={val.text}
                    textInner={val.textInner}
                  />
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
